import React from 'react';
import '../css/About.css';
import nateshim from '../static/nateshim.jpg'
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';
import Container from '@material-ui/core/Container';
import Avatar from '@material-ui/core/Avatar';
import { makeStyles } from '@material-ui/core/styles';


const useStyles = makeStyles({
  avatar: {
    margin: '100px',
    width: '380px',
    height: 380,
  },
});
function About() {
  const classes = useStyles();
  return (
    <div className="About">
      <header className="About-header">
        <Box display="flex" flexDirection="row">
          <Avatar src={nateshim}  className = {classes.avatar} alt = "nateshim"></Avatar>
        </Box>
        <Container>
          <Typography>
            NATHANAEL SHIM
          </Typography>
        </Container>
        <Box>
          <Typography>Contact</Typography>
          <Typography>Email: nateshim@gmail.com</Typography>
          <Typography>Phone number: (510)-710-2091 </Typography>
          <Typography>Linkedin: https://www.linkedin.com/in/nathanael-shim-324b55115/</Typography>
        </Box>

      </header>
    </div>
  );
}

export default About;
